import './Login.css';
import { useState } from 'react';

const Login = () => {

    const [formData, setFormData] = useState({
        username: "",
        password: "",
    });

    const handleInputChange = (e) => {
        const target = e.target;
        const name = target.name;

        setFormData({
            ...formData,
            [name]: target.value,
        });
    };
    console.log(formData)

    return(
         <div className="login">
             <form>
                 <input type="text" name="username" placeholder="User name" value={formData.username} onChange={handleInputChange}/>

                 <input type="password" name="password" placeholder="password" value={formData.username} onChange={handleInputChange}/>

                 <button className="btn">Login</button>
             </form>
         </div>
    );
}

export default Login;
